DROP TABLE IF EXISTS `t_comment`;
CREATE TABLE `t_comment`  (
  `comment_id` bigint(0) NOT NULL AUTO_INCREMENT COMMENT '   主键',
  `content` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL DEFAULT NULL COMMENT '评论的内容',
  `parent_id` bigint(0) NULL DEFAULT NULL COMMENT '回复的评论(接收者)ID',
  `order_id` bigint(0) NULL DEFAULT NULL COMMENT '评论的（文章）内容ID',
  `send_id` bigint(0) NULL DEFAULT NULL COMMENT '评论发送者ID',
  `vote_up` int(0) UNSIGNED NULL DEFAULT 0 COMMENT '“顶”的数量',
  `vote_down` int(0) UNSIGNED NULL DEFAULT 0 COMMENT '“踩”的数量',
  `level` tinyint(0) UNSIGNED NULL DEFAULT 0 COMMENT '置顶等级',
  `status` tinyint(0) NULL DEFAULT 1 COMMENT '状态（0：禁用；1：启用）',
  `create_time` datetime(0) NULL DEFAULT CURRENT_TIMESTAMP(0) COMMENT '创建时间',
  `update_time` datetime(0) NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP(0) COMMENT '修改时间',
  `user_name` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '发送用户名',
  `parent_name` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '接收用户名',
  `comment_louzhu` tinyint(0) NULL DEFAULT NULL COMMENT '发送者是否此文章楼主，0不是，1是',
  `type` tinyint(0) NULL DEFAULT NULL COMMENT '某类型，核酸隔离疫苗轨迹',
  `type_name` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '该类型名字（核酸隔离疫苗轨迹）',
  `parent_read` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '接收者0未读，1已读',
  `message_type` tinyint(0) NULL DEFAULT NULL COMMENT '消息类型（0：系统消息；1：评论文章；2：回复评论）',
  `user_remark` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '用做typeId',
  `admin_remark` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  PRIMARY KEY (`comment_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 165 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '博客评论' ROW_FORMAT = Dynamic;

